import '../App.css';
import React, { useState } from "react";
function Create(){
    const [nameinput, setNameinput]= useState('');
    const [emailinput, setEmailinput]= useState('');

    return(
     <div className='container mt-5 border p-2'>
        <form>
        <div class="form-group">
            <label for="exampleInputEmail1">Name</label>
            <input type="email" class="form-control" onChange={e => setNameinput(e.target.value)} id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email"/>
        </div>
        <div class="form-group">
            <label for="exampleInputPassword1">Email</label>
            <input type="password" class="form-control" onChange={e => setEmailinput(e.target.value)} id="exampleInputPassword1" placeholder="Password"/>
        </div>
        <button type="submit" class="btn btn-primary">Submit</button>
    </form>
     </div>
    )
}

export default Create;
